import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css";

import PokemonAbilities from "./Components/PokemonAbilites";

function App() {
  const [name, setName] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get("http://localhost:5001/pokemon");
      setName(response.data.data);
    };
    fetchData();
  }, []);
  return (
    <div className="App">
      {name?.map((i, index) => (
        <PokemonAbilities pokemonName={i.name} />
      ))}
    </div>
  );
}
export default App;
